-- Add each feature to each affiliate (disable C2C for now)
INSERT INTO dbo.AffiliateFeature (AffiliateID, FeatureID, IsEnabled )
	SELECT A.AffiliateID, AF.FeatureID, CASE WHEN AF.FeatureID = 1 THEN 0 ELSE 1 END
	FROM dbo.Affiliate A, dbo.Feature AF
	WHERE AF.FeatureID IN ( 1, 2, 3 )


-- C2C Settings
INSERT INTO [dbo].[AffiliateFeatureSetting] ( [AffiliateFeatureID], [FeatureSettingID], [Value] )
	SELECT
		AF.AffiliateFeatureID,
		FS.FeatureSettingID,
		[Value] = 'This feature is currently disabled'		
	FROM
		[Innova].[dbo].[AffiliateFeature] AF
		JOIN [Innova].[dbo].[FeatureSetting] FS
			ON AF.FeatureID = FS.FeatureID
	WHERE
		AF.FeatureID = 1
		AND FS.FeatureSettingID = 1


-- Add QlikView Settings
INSERT INTO [dbo].[AffiliateFeatureSetting] ( [AffiliateFeatureID], [FeatureSettingID], [Value] )
SELECT
	AF.AffiliateFeatureID,
	FS.FeatureSettingID,
	[Value] = 
		CASE FS.FeatureSettingID			
			WHEN 2 THEN -- Base Url
				CASE 
					WHEN ( @@SERVERNAME LIKE '%CTQ%' OR @@SERVERNAME LIKE '%QCOLSQL00%' OR @@SERVERNAME LIKE '%DCOLSQL00%' ) THEN
						CASE WHEN AF.AffiliateID = 1 AND ( @@SERVERNAME LIKE '%QCOLSQL00%' OR @@SERVERNAME LIKE '%DCOLSQL00%' ) THEN 'https://qa-qlikview.firstallied.com/QvAJAXZfc'
								ELSE 'https://qa-qlikview.guideportcfg.com/QvAJAXZfc'
						END
					WHEN ( @@SERVERNAME LIKE '%CTP%' OR @@SERVERNAME LIKE '%PCOL%' ) THEN
						CASE WHEN AF.AffiliateID = 1 AND @@SERVERNAME LIKE '%PCOL%' THEN 'https://qlikView.firstallied.com/QvAJAXZfc'
								ELSE 'https://qlikview.guideportcfg.com/QvAJAXZfc'
						END
					ELSE 'https://qlikview.guideportcfg.com/QvAJAXZfc'
				END			
			WHEN 3 THEN -- Dasboard Doc
				'PEAK_PMP.qvw&select=LB_SheetName,Main'			
			WHEN 4 THEN -- User Identifier Field
				CASE WHEN @@SERVERNAME LIKE '%QCOLSQL00%' AND AF.AffiliateID = 1 THEN
					'ProfileID'
				ELSE
					'UserID'
				END
			ELSE 
				NULL
		END
FROM
	[Innova].[dbo].[AffiliateFeature] AF
	JOIN [Innova].[dbo].[FeatureSetting] FS
		ON AF.FeatureID = FS.FeatureID
WHERE
	AF.FeatureID = 3
GO


